sys_variable_value.value:
(function execute(inputs, outputs) {
    var gr = new GlideRecord('x_snc_ai_agents_0_fso_sma_onboarding');
    gr.addQuery('number', inputs.case_number);
    gr.query();

    if (gr.next()) {
        var result = {
            // Currency
            funding_amount: gr.getValue('funding_amount'),

            // Choice fields (display values)
            investment_benchmark: gr.getDisplayValue('investment_benchmark'),
            investment_strategy: gr.getDisplayValue('investment_strategy'),
            time_horizon: gr.getDisplayValue('time_horizon'),
            tolerance: gr.getDisplayValue('tolerance'),
            tax_exempt: gr.getDisplayValue('tax_exemp0'),
            acknowledged: gr.getDisplayValue('acknowledgement'),
            expect_capital_gains: gr.getDisplayValue('expect_capital_gains'),
            director_policy_maker: gr.getDisplayValue('director_policy_10_stakeholder'),
            employee_or_family: gr.getDisplayValue('employee_or_immediate_family_membe0'),
            erisa_or_ira: gr.getDisplayValue('erisa_ira'),

            // String fields (raw values)
            client_or_custodian_account: gr.getValue('client_or_custodian_account'),
            cusip: gr.getValue('cusip'),
            custodian_name: gr.getValue('custodian_name')
        };

        // Output as a single JSON string
        outputs.result = JSON.stringify(result);
    } else {
        gs.info('[Flow Step] No record found for Case Number: ' + inputs.case_number);
        outputs.result = JSON.stringify({ error: 'No onboarding record found for the given case number.' });
    }
})(inputs, outputs);

